import React from 'react';

function HomePage() {
  return (
    <div className="container mt-5" style={{ paddingTop: '80px' }}>
      <h1>Welcome to the Quiz App!</h1>
      <p>Start by taking a quiz or learn more about us.</p>
    </div>
  );
}

export default HomePage;
